mcs_IR_mode="Infrarotmodus";mcs_IR_mode_detail="Nachdem der Infrarotmodus ausgewählt wurde, schaltet sich das Infrarotlicht ein, wenn nachts nicht genug Licht vorhanden ist";mcs_white_light_mode="Weißlicht-Modus";mcs_white_light_mode_detail="Nach Auswahl des Weißmodus schaltet sich das weiße Licht ein, wenn nachts nicht genügend Licht vorhanden ist";mcs_smart_mode="Intelligenter Modus";mcs_smart_mode_detail="Nachdem der Smart-Modus ausgewählt wurde, ist das Infrarotlicht die Standardeinstellung, wenn nachts nicht genug Licht vorhanden ist. Wenn sich das Objekt bewegt, wird das weiße Licht für eine Minute auf das weiße Licht geschaltet";mcs_sos_alarm_detail="Wenn der Schalter eingeschaltet ist, wird eine Alarmbenachrichtigung gedrückt, wenn die SOS-Taste gedrückt wird";mcs_move_alarm_new_detail="Nach dem Einschalten des Alarmschalters, wenn sich jemand oder ein Objekt bewegt, erkennt die Kamera automatisch die Alarmbenachrichtigung und drückt sie";mcs_move_alarm_detail="Nachdem der Schalter eingeschaltet wurde, wird bei Auftreten einer Anomalie im Videodetektionsbildschirm eine Alarmbenachrichtigung ausgelöst";mcs_door_record_detail="Nachdem der Schalter eingeschaltet wurde, wird das Video ausgelöst, wenn Tür und Fenster geöffnet werden und das Video bei geschlossener Tür und Fenster gestoppt wird";mcs_sos_record_detail="Nachdem der Schalter eingeschaltet wurde, wird das Video ausgelöst, wenn die SOS-Taste gedrückt wird, und das Video wird angehalten, wenn die SOS-Taste losgelassen wird";mcs_move_record_detail="Nachdem der Schalter eingeschaltet wurde, wird das Video ausgelöst, wenn auf dem Videodetektionsbildschirm eine Störung auftritt";mcs_Allow_alarm_schedule="Zugelassene Alarmzeit";mcs_Allow_record_schedule="Zugelassene Aufnahmenzeit";mcs_no_sd_hint="Es wurde keine SD-Karte erkannt. Überprüfen Sie, ob die SD-Karte korrekt in die Kamera eingesetzt wurde";mcs_feedback_type="Feedbacktyp";mcs_connection_problems="Verbindungsprobleme";mcs_interface_design="Schnittstellendesign";mcs_functional_issues="Funktionelle Probleme";mcs_show_problem="Problem anzeigen";mcs_word_map_wrong="Wortkarte falsch";mcs_photo_issue="Foto Problem";mcs_other_questions_or_suggestions="Andere Fragen oder Vorschläge";mcs_contact_information="Kontaktinformationen";mcs_contact_information_tips="Bitte hinterlassen Sie QQ / Telefonnummer und andere Kontaktinformationen (erforderlich)";mcs_shoot="Schießen";mcs_choose_from_phone_albums="Wählen Sie aus Telefonalben";mcs_please_login_first="Bitte loggen Sie sich zuerst ein";mcs_how_to_export_sd="Wie exportiert man SD-Kartendaten?";mcs_export_SD_card_operation_mode="Exportieren Sie den SD-Karten-Betriebsmodus";mcs_please_first="Zuerst";mcs_insert_the_memory_card_reader="Setzen Sie den Speicherkartenleser ein";mcs_select_export_SD_card_data="Klicken Sie auf Mehr, um SD-Kartendaten zu exportieren";mcs_select_export_SD_path="Klicken Sie, um den Pfad auszuwählen (wählen Sie, um den Dateipfad zu speichern, muss englischer Name sein)";mcs_start_export_SD="Klicken Sie auf Exportieren, um mit dem Export von SD-Kartendaten zu beginnen";mcs_normal_mode="Normaler Modus";mcs_long_video_mode="Langer Videomodus";mcs_super_long_video_mode="Super langer Videomodus";mcs_notify_back="Bildschirmbenachrichtigung sperren";msc_display_notify_back="Sperrbildschirmbenachrichtigung anzeigen";mcs_hint_notify_back_success="Wenn das Telefon gesperrt ist, kann eine Benachrichtigungsvorschau angezeigt werden.";mcs_hint_notify_back="Wenn Sie die Sperrbildschirmbenachrichtigung aktivieren, kann das Telefon eine Vorschau der Benachrichtigung im Sperrbildschirmzustand anzeigen.Es muss %1$s erlauben, die Akkuoptimierung zu ignorieren, und die Anwendung behält die Netzwerkverbindung im Hintergrund bei.";mcs_device_add_app_invalid="Ungültige Geräte-ID";mcs_device_add_loc_invalid="Gerät befindet sich nicht im Servicebereich";mcs_pic_look="Sie können Bilder in lokalen Dateien anzeigen";mcs_quit_fullscreen="Beenden Sie den Vollbildmodus und drücken Sie ecs";mcs_click_add_equipment="Klicken Sie auf Gerät hinzufügen";mcs_storage_buying="Geh zum Einkaufszentrum, um zu kaufen";mcs_device_offline_b="Das Gerät ist offline (siehe Abbildung), schließen Sie das Gerät an die Stromversorgung an und warten Sie 60 Sekunden Die grüne LED blinkt einmal alle drei Sekunden Das Gerät startet";mcs_device_offline_s1="Das Gerät ist offline (siehe Abbildung), schließen Sie das Gerät an die Stromversorgung an, warten Sie 60 Sekunden geduldig, die Anzeige blinkt und das Gerät startet";mcs_device_offline_p="Das Gerät ist nicht online.Wie in der Abbildung gezeigt, schließen Sie das Gerät an die Stromversorgung an, warten Sie 60 Sekunden lang und hören Sie das Geräusch des Abfalls, und das Gerät startet";mcs_check_router_blink="Überprüfen Sie, ob die Netzwerkanschluss-LEDs des Routers blinken. Wenn nicht, ersetzen Sie die Netzwerkanschlüsse";mcs_press_no_voice="Nachdem Sie versucht haben, das Gerät für 10 Sekunden erneut zu drücken, wenn Sie die Sprachansage noch nicht gehört haben";mcs_history_played_save="Das Verlaufswiedergabevideo wird im ausgewählten Pfad gespeichert";mcs_modify_device_password_limit="8-32-Bit Buchstaben oder Zahlen";mcs_remove_ethernet="Trennen Sie die Ethernet-Verbindung";mcs_not_remove_ethernet_alert="Sie haben das Ethernet-Kabel nicht entfernt. Dies könnte zu einer Fehlfunktion des Geräts führen";mcs_remove_ethernet_tip="Wenn die drahtlose Verbindung (WLAN) und die Netzwerkkabelverbindung (Ethernet) gleichzeitig funktionieren, funktioniert das Gerät möglicherweise nicht ordnungsgemäß.Wenn Sie das Netzwerkkabel trennen, stellt das Gerät die Verbindung zum Server wieder her und schaltet nach etwa 60 Sekunden automatisch online.";mcs_still_can_not_add_device="Wenn Sie das Gerät immer noch nicht hinzufügen können, versuchen Sie es mit der Netzwerkkabelverbindung.Nachdem die Netzwerkkabelverbindung erfolgreich ist, folgen Sie den App-Richtlinien, um eine Verbindung mit WLAN herzustellen.Nachdem die WLAN-Verbindung erfolgreich hergestellt wurde, können Sie das Netzwerkkabel trennen.";mcs_not_hear_prompt_voice="Sprachansagen nicht gehört?";mcs_config_wifi_with_hole="Halten Sie das Reset-Loch für 1 Sekunde mit dem Metallstift im Kit fest und lassen Sie es los. Die Kamera empfängt nun Informationen zur drahtlosen Konfiguration und eine Sprachaufforderung wird abgespielt.";mcs_config_wifi_with_press_reset="Halten Sie die Reset-Taste für 1 Sekunde gedrückt und lassen Sie sie los. Die Kamera empfängt nun Informationen zur drahtlosen Konfiguration und eine Sprachaufforderung wird abgespielt.";mcs_device_password_too_simple="Bitte geben Sie das Gerätepasswort ein, die Passwortlänge beträgt 8-32 Bit, muss englische Buchstaben und Zahlen enthalten";mcs_closer_with_router_in_config="Bewahren Sie die Kamera während der Konfiguration so nahe wie möglich am Router auf";mcs_tap_to_switch="Klicken Sie hier, um zu wechseln";mcs_camera_not_support_5G_but_connected="Die Kamera unterstützt kein 5G WLAN.";mcs_camera_not_support_5G="Die Kamera unterstützt kein 5G WLAN. Wenn das aktuelle Mobiltelefon mit 5G WLAN verbunden ist,";mcs_camera_turn_on_voice="Prompte Ton";mcs_discovery_same_lan_devices="Neues Gerät gefunden";mcs_tap_to_turn_light_on="Zum Einschalten tippen";mcs_tap_to_turn_light_off="Zum Ausschalten tippen";mcs_scan_qr_code_on_device="Bitte richten Sie die Box mit dem QR-Code des Gerätekörpers aus";mcs_user_name_limit="Der Benutzername muss mit einem Buchstaben beginnen. Muss 6-32 Zeichen enthalten (Sie können Buchstaben, Zahlen verwenden)";mcs_user_name_limit_android="Der Benutzername muss mit einem Buchstaben beginnen. Muss 6-32 Zeichen enthalten (Sie können Buchstaben, Zahlen verwenden)";mcs_user_password_limit="Das Passwort muss eine Kombination aus Buchstaben und Zahlen mit einer Länge von 8-32 Zeichen sein";mcs_user_password_limit_android="Das Passwort muss eine Kombination aus Buchstaben und Zahlen mit einer Länge von 8-32 Zeichen sein";mcs_input_nick_name="Gib einen Spitznamen ein";mcs_wifi_configuration="WLAN";mcs_ethernet_cable="Ethernet Kabel";mcs_smart_config_wifi="WLAN Konfiguration";mcs_close_to_device_in_config="Bitte schalten Sie den Lautsprecher Ihres Telefons ein und halten Sie ihn so nah wie möglich an der Kamera";mcs_connect_ethernet_to_fnk1m_camera="Verbinden Sie die Kamera über ein Ethernetkabel mit dem Router";mcs_connect_ethernet_to_p1_camera="Verbinden Sie die Kamera über ein Ethernetkabel mit dem Router";mcs_set_deivce_nick_page_title="Geräte-Nickname festlegen";mcs_set_device_password_page_title="Gerätekennwort einstellen";mcs_select_time_zone_page_title="Wählen Sie die Zeitzone aus";mcs_connect_ethernet_page_title="Netzwerkkabelverbindung";mcs_f1_device_connect_power="Warten Sie nach dem Einschalten bitte 30 Sekunden, bis das Infrarotlicht erlischt und die Kamera hochfährt";mcs_reconnect_power="Bitte trennen Sie die Stromversorgung des Geräts und schließen Sie es erneut an. Versuchen Sie, das Gerät erneut hinzuzufügen.";mcs_press_button_restore_to_reset_password='Drücken Sie die Reset-Taste und halten Sie sie 10 Sekunden lang gedrückt, bis Sie eine Sprachansage "Wiederherstellung auf Werkseinstellung erfolgreich" hören, die Kamera wird neu gestartet und das Passwort auf "admin" zurückgesetzt.';mcs_press_hole_restore_to_reset_password="Verwenden Sie den Metallstift im Kit, um die Reset-Taste zu drücken.Nach 10 Sekunden ertönt eine Sprachaufforderung, um mit der Wiederherstellung der Werkseinstellungen zu beginnen.Nachdem der Metallstift gelöst wurde, wird das Gerät automatisch neu gestartet und das Passwort wird nach dem Neustart in admin wiederhergestellt.";mcs_applicable_band="Anwendbare Frequenz: 2,4 GHz (Wenn Sie einen Dual-Frequenz-Router verwenden, überprüfen Sie bitte, ob Ihr Telefon mit dem 5GHZ WLAN verbunden ist. Bitte stellen Sie sicher, dass Ihr Telefon vor dem Start der WLAN-Konfiguration mit dem 2,4GHZ WLAN verbunden ist .";mcs_transmission_standard="Übertragungsstandard: IEEE 802.11b / g / n";mcs_encryption="Verschlüsselung: WPA, WPA2";mcs_leave_contact_information="Bitte hinterlassen Sie Kontaktinformationen (erforderlich)";mcs_input_device_password="Geben Sie das Gerätepasswort ein";msc_use_ethernet_cable_connect="Bitte verwenden Sie ein Netzwerkkabel, um den Router und den Netzwerkanschluss des Geräts zu verbinden.Nachdem die Verbindung erfolgreich hergestellt wurde, geht das Gerät automatisch online.";mcs_choose_other_method_connect="Die Konfiguration ist fehlgeschlagen. Tippen Sie auf, um es erneut zu versuchen, oder wählen Sie eine andere Verbindungsmethode aus.";mcs_not_hear_prompt_voice_no_symbol="Ich habe keine Sprachansagen gehört";mcs_upload_video="Video hochladen";mcs_upload_video_tip="Wenn der Cloud-Speicher aktiviert ist, lädt das System das Video automatisch in das Cloud Storage Security Center hoch. Video-Upload-Prozess steht unter dem Schutz der Verschlüsselungstechnologie, Sie sind versichert.";mcs_renew="Verlängerungen";mcs_package_type="Typ";mcs_vbox_use_instruction="Cloud Storage-Dienstbeschreibung";mcs_unbind="Lösen";mcs_seven_day_package="7 Tage rollende Cloud-Speicheraufzeichnung";mcs_fifteen_day_package="15 Tage rollende Cloud-Speicheraufzeichnung";mcs_thirty_day_package="30 Tage rollende Cloud-Speicheraufzeichnung";mcs_fortyfive_day_package="45 Tage lang rollende Cloud-Speicheraufzeichnung";mcs_ninty_day_package="90 Tage rollende Cloud-Speicheraufzeichnung";mcs_get_cloud_info_fail="Fehler beim Abrufen von Cloud-Speicherinformationen";mcs_unbind_success="Erfolgreich gelöst";mcs_unbind_fail="Fehler beim Lösen";mcs_unbind_tip="Nach der Entbündelung lädt der Cloud-Speicher keine Videos mehr. Bereits gespeicherte Videos werden nach Ablauf der Cloud-Speicherzeit automatisch gelöscht.";mcs_no_buy_vbox="Sie haben keinen Cloud-Speicherdienst erworben";mcs_have_active_code_input="Cloud-Speicheraktivierungscode";mcs_input_active_code="Bitte geben Sie den Aktivierungscode ein";mcs_active_now="Aktiviert";mcs_active_fail="Aktivierung fehlgeschlagen";mcs_active_success="Erfolgreich aktiviert";mcs_renew_success="Erfolgreich erneuert";mcs_renew_fail="Verlängerung fehlgeschlagen";mcs_active_code_empty="Der Aktivierungscode darf nicht leer sein";mcs_vbox_about="Über";mcs_clean_data="Daten löschen";mcs_clean_data_tip="Löschen Sie Cloud-Speicherdaten";mcs_vbox_id="Cloud-Speicher-ID";mcs_bind_device="Verbundene Geräte";mcs_vbox_invalid_date="Ablaufdatum des Cloud-Speichers";mcs_upload_info="Upload Information";mcs_can_choose_vbox_use="Sie haben einen Cloud-Speicherplan abonniert und es ist noch Speicherplatz verfügbar, den Sie verwenden können.";mcs_change_vbox="Umschalten";mcs_change_vbox_success="Umschalten zum Cloud-Speicher erfolgreich";mcs_change_vbox_fail="Umschalten zum Cloud-Speicher fehlgeschlagen";mcs_vbox_instruction="Kurze Einführung";mcs_vbox_instruction_text="Die Cloud-Speicherfunktion ist eine von der Kamera entwickelte Videospeicherfunktion, die auf Technologien wie der Erkennung bewegter Objekte basiert. Wenn die Kamera ein sich bewegendes Ereignis erkennt, beispielsweise eine vorbeifahrende Person oder ein bewegtes Objekt, zeichnet die Kamera automatisch das Video auf und lädt es mit hoher Verschlüsselung in die Cloud hoch, wodurch die vom Benutzer verursachte Zerstörung und der Verlust von Schlüsseldaten durch die Zerstörung der SD-Karte wirksam verhindert wird.";mcs_vbox_instruction_buy="Wie kaufe ich Cloud-Speicher?";mcs_vbox_instruction_buy_text="Wählen Sie Gerät - [Einstellungen] - [Cloud-Speicher] - [Cloud-Speicher aktivieren] - [Cloud-Speicherplatz kaufen] zum Kauf aus.";mcs_vbox_buy_tip_title="Tipps:";mcs_vbox_buy_tip_text1="1) Der Cloud-Speicherdienst unterstützt keine Rückgabe nach erfolgreichem Kauf, keine Rückerstattung";mcs_vbox_buy_tip_text2="2) Der Cloud-Speicher ist nur an den kaufenden Benutzer gebunden, das Gerät mit dem Cloud-Speicher-Service wird gelöscht und ein neues Konto wird hinzugefügt.Das Gerät kann unter dem neuen Konto den Cloud-Speicher-Service nicht weiter nutzen.";mcs_how_calculate_service_time="Berechnung der Servicezeit nach dem Kauf des Cloud-Speichers";mcs_calculate_describe="Wenn Ihr Einkauf erfolgreich und aktiviert ist, kann Cloud-Speicher verwendet werden und wir beginnen mit der Berechnung der Servicezeit am Aktivierungstag. Wenn Sie beispielsweise am 13. April 2017 7 Tage lang einen Rolling Cloud Storage-Service erworben haben und das Aktivierungsdatum der 14. April 2017 ist, endet die Service-Kündigungsfrist am 14. Mai 2017 und die Speicherung beginnt am 14. April 2017. Ab dem 20. April 2017. Am 21. April 2017 wird das Cloud-Speichervideo vom 14. April 2017 automatisch gelöscht und die Cloud-Speicherdaten vom 15. April 2017 bis 21. April 2017 werden beibehalten und die Tagesdaten werden in Zukunft einzeln gelöscht.";mcs_vbox_instruction_renew="Erneuerung des Cloud-Speichers";mcs_vbox_instruction_renew_text1="1) Wenn Ihr gekaufter Cloud-Speicher abgelaufen ist, können Sie andere Arten von Paketdiensten erneuern oder kaufen. Nach der Kaufaktivierung wird das neue Cloud-Speicherpaket sofort wirksam.";mcs_vbox_instruction_renew_text2="2) Wenn der von Ihnen gekaufte Cloud-Speicherdienst nicht abgelaufen ist, erwerben Sie denselben Paketdienst (die gleiche Art von Videospeicherdauer), und der neue Dienst verlängert die Dienstzeit in der ursprünglichen Dienstzeit.";mcs_vbox_instruction_renew_text3="3) Wenn der von Ihnen gekaufte Cloud-Speicherdienst nicht abgelaufen ist und Sie den neuen Paketdienst ersetzen möchten, werden verschiedene Arten von Paketaustauschdiensten nicht unterstützt Sie müssen den Cloudspeicher trennen, bevor Sie einen neuen Cloudspeicherdienst erwerben können. Lagerung kann normal verwendet werden.";mcs_vbox_instruction_reset="Kamera Werkseinstellung";mcs_vbox_instruction_reset_text="Die Kamera verliert die Verbindung zum Cloud-Speicher, nachdem sie auf die Werkseinstellungen zurückgesetzt wurde. Sie müssen es erneut aktivieren, um die Verlaufsdaten wiederherzustellen.";mcs_vbox_unbind="Cloud-Speicher wird aufgelöst";mcs_vbox_unbind_text1="1) Nachdem der Cloudspeicher und die Kamera gelöst wurden, wird das Video der Kamera nicht mehr gespeichert und das gespeicherte Video wird nach Ablauf der Servicezeit automatisch gelöscht.";mcs_vbox_unbind_text2="2) Nach der Entbündelung kann der Cloud-Speicher an andere Kameras gebunden werden. Nach dem Binden anderer Kameras wird das zuvor gespeicherte Video bei der nächsten Zyklusaufnahme gelöscht.Wenn Sie 7 Tage lang einen Rolling Cloud Storage-Service erworben haben, ist der Cloud-Speicher an Kamera A gebunden und vor Kamera A an Kamera B gebunden. Das gespeicherte siebentägige Video wird am achten Tag der Loop-Aufnahme automatisch gelöscht. Der Cloud-Speicherdiensttyp und die Ablaufzeit sind unverändert.";mcs_vbox_choose="Wählen Sie den Cloud-Speicher aus";mcs_vbox_choose_text1="Wählen Sie Gerät - [Einstellungen] - [Cloud-Speicher] - [Cloud-Speicher aktivieren] - [Cloud-Speicher auswählen] zur Auswahl aus";mcs_vbox_choose_text2="Wenn Sie das Gerät gekauft und den Cloud-Speicher gekauft haben, wurde das Gerät aus irgendeinem Grund zurückgegeben (Hinweis: Nach dem Kauf des Cloud-Speicherdienstes wird die Rückgabe nicht unterstützt, keine Rückerstattung wird unterstützt) Sie können das Gerät und den Cloud-Speicher entfernen. Cloud Storage ist an Ihr neues Gerät gebunden.";mcs_vbox_choose_tip_text1="1) Für Cloud-Speicher und Kontenbindung kann nur das gleiche Konto verwendet werden: Das ungebundene Cloud-Speichergerät und das gebundene Cloud-Speichergerät müssen sich unter demselben Konto befinden.";mcs_vbox_choose_tip_text2="2) Cloud-Speicheroptionen können nur verwendet werden, wenn Sie über freien Cloud-Speicherplatz verfügen.";mcs_input_pwd="Bitte geben Sie Ihr Passwort ein";mcs_bind_fail="Die Gerätebindung ist fehlgeschlagen";mcs_pwd_empty="Das Passwort darf nicht leer sein";mcs_set_pwd_success="Passwort erfolgreich gesetzt";mcs_set_pwd_fail="Passwort konnte nicht eingestellt werden";mcs_open_upload_yet="Upload aktiviert";mcs_open_u